import React from 'react';
import {Link, BrowserRouter} from "react-router-dom";
import '../../App';

const Navbar = () =>{
    return (
        <nav className="main-navbar bg-main">
            <h2>
                <BrowserRouter>
                    <Link to="#" style={{color: "black"}}>YourPartner</Link>
                </BrowserRouter>
            </h2>
            <ul>
                <li to="#">
                    <BrowserRouter>
                    <Link>Register</Link>
                    </BrowserRouter>
                </li>
                <li to="#"></li>
            </ul>
        </nav>
    );
};

export default Navbar;
